import React from 'react'
import { ModelItem } from '../ModelItem/ModelItem'
import c from '../';

export const Catalogs = (props) => {
    
    let product = props.product.filter(p=>{
        
        return p.type.some(t => t === props.type)});
        
  return (
    <div>
        {props.title}
        <div className={c}>

        </div>
        {product.map((p)=>{
            return <ModelItem name={p.name} title={p.title} id={p.id} sale={p.sale} cost={p.cost}/>
        })}
        
    </div>
  )
}
